import React from "react";
// import "bootstrap/dist/css/bootstrap.min.css";

import "../../assets/css/compeounder.css"; // Adjust the path as needed
import "../../assets/css/innerstyle.css"; // Adjust the path if necessary

const MotivePage = () => {
  return (
    <div>
      <section className="solution-wrapper-sec1">
        <div className="container">
          <div className="row">
            <div className="col-md-12">
              <p>
                Unlock the full potential of your organization with our B2B
                services designed to liberate you from non-core tasks.
                Leveraging connections within the platform community and their
                cumulative experience, we can heavy lift your operational
                burden, allowing you to maximize your productivity and
                innovation. Partner with us to transform your business potential
                into reality.
              </p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default MotivePage;
